#!/bin/sh -e
# Uses the REST API of the web application to create a data fixture.

exec 2<&1
set -x

# Create users
curl -X POST -H 'Content-Type: application/json' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/users' \
--data '{"login":"pepe","name":"Pepe Fernández","password":"pepepepe","email":"pepe@pepe.net","picture":"iVBORw0KGgoAAAANSUhEUgAAAAgAAAAIAQMAAAD+wSzIAAAABlBMVEX///+/v7+jQ3Y5AAAADklEQVQI12P4AIX8EAgALgAD/aNpbtEAAAAASUVORK5CYII="}'

curl -X POST -H 'Content-Type: application/json' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/users' \
--data '{"login":"manolo","name":"Manolo Pérez","password":"manolitojeje","email":"manolo@manolo.net"}'

curl -X POST -H 'Content-Type: application/json' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/users' \
--data '{"login":"roberto","name":"Roberto López","password":"robertoabierto","email":"roberto@roberto.net"}'

# Create and accept friendship from pepe to manolo
curl -X POST -H 'Content-Type: application/x-www-form-urlencoded' \
-H 'Authorization: Basic cGVwZTpwZXBlcGVwZQ==' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/friendships' \
--data targetLogin=manolo

curl -X PUT -H 'Content-Type: application/x-www-form-urlencoded' \
-H 'Authorization: Basic bWFub2xvOm1hbm9saXRvamVqZQ==' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/friendships/pepe' \
--data accepted=true

# Create link, video and photo posts by pepe
curl -X POST -H 'Content-Type: application/json' \
-H 'Authorization: Basic cGVwZTpwZXBlcGVwZQ==' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/posts' \
--data '{"link":{"url":"https://moovi.uvigo.gal"}}'

curl -X POST -H 'Content-Type: application/json' \
-H 'Authorization: Basic cGVwZTpwZXBlcGVwZQ==' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/posts' \
--data '{"video":{"duration":3000000000}}'

# Create a post with a pretty big (but realistic) picture
curl -X POST -H 'Content-Type: application/json' \
-H 'Authorization: Basic cGVwZTpwZXBlcGVwZQ==' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/posts' \
--data @- <<PAYLOAD
{"photo":{"content":""}}
PAYLOAD

# manolo likes the link post made by pepe
curl -X POST -H 'Authorization: Basic bWFub2xvOm1hbm9saXRvamVqZQ==' \
-i 'http://localhost:8080/web-0.0.1-SNAPSHOT/api/v1/posts/1/like'
